import React from 'react'

const ListGroup = (props) => {
  let { items, textProperty, valueProperty } = props
  return (
    <ul className="list-group">
      {items.map((item) => (
        <li key={item[textProperty]} className="list-group-item">
          {item[valueProperty]}
        </li>
      ))}
    </ul>
  )
}

export default ListGroup
